    [],nt"revision_timestamp": "2016-10-08T15:56:06.833888",nt"name": "fish-passage-report-baca-national-wildlife-refuge",nt"isopen":
    false,nt"url": null,nt"notes": "This fish passage report was prepared for
    the Colorado Fish and Wildlife Conservation Office to inform them of possible fish
    passage issues on streams that provide Baca National Wildlife Refuge with surface
    water.  Three of the six streams providing water to the refuge contain the Rio Grande
    chub and the Rio Grande sucker, both of which are species of concern.  These three
    streams, Crestone, Willow, and Cottonwood) were intensively surveyed for fish passage
    issues, habitat types, in-stream structures, water depth, and discharge.  Locations,
    pictures, and diagnostics of each water structure that may cause a fish passage
    issue is included in this report.  Recommendations on fish passage and fish habitat
    on Baca National Wildlife Refuge are provided in the discussion.",nt"license_title":
